export default class ChampionTierModel{
    rank:number;
    change:number;
    name:string;
    position:string;
    winRate:string;
    pickRate:string;
    banRate:string;
    tierIcon:string;

    constructor(data:ChampionTierModel){
        this.rank=data.rank;
        this.change=data.change;
        this.name=data.name;
        this.position=data.position;
        this.winRate=data.winRate;
        this.pickRate=data.pickRate;
        this.banRate=data.banRate;
        this.tierIcon=data.tierIcon;
    }
}
